import { StyleSheet } from "react-native";
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import ProfileCard from "./components/home/ProfileCard";
import { MaterialCommunityIcons } from "react-native-vector-icons"
import List from "./components/list/List";
import Name from "./components/name/Name"
import ChatGPT from "./components/chatgpt/ChatGPT";

const Tab = createBottomTabNavigator();
const handleButtonClick = () => {
    // Cambiar el color del botón y el texto al hacer clic
    setButtonColor('green');
    setTextColor('black');
  };


export default function Navigation() {
    return (
        <Tab.Navigator>
            <Tab.Screen   name=" " component={ProfileCard} options={{

                tabBarLabel: "Diagnóstico",
                tabBarIcon: ({ color, size }) => {
                    return <MaterialCommunityIcons onPress={handleButtonClick} name="hospital-box-outline" style={styles.tabBarIcon} color={color} size={size} />
                }
            }} />
            <Tab.Screen   name="list" component={List} options={{
                tabBarLabel: "Información",
                tabBarIcon: ({ color, size }) => {
                    return <MaterialCommunityIcons name="information" style={styles.tabBarIcon} color={color} size={size} />
                }
            }} />
            <Tab.Screen  name="name" component={Name} options={{
                tabBarLabel: "Estadísticas",
                tabBarIcon: ({ color, size }) => {
                    return <MaterialCommunityIcons name="chart-bar" style={styles.tabBarIcon} color="green" size={size} />
                }
            }} />
            <Tab.Screen  name="chatgpt" component={ChatGPT} options={{
                tabBarLabel: "Configuración",
                tabBarIcon: ({ color, size }) => {
                    return <MaterialCommunityIcons name="account-cog" style={styles.tabBarIcon} color={color} size={size} />
                }
            }} />

        </Tab.Navigator>

    );
}

const styles = StyleSheet.create({
    tabBarIcon: {

      },
      tabBarLabel: {
        fontSize: 25,
        fontWeight: 'bold',
      },
});
